import React from 'react';
import { BrowserRouter as Router, Route, Routes, Navigate } from 'react-router-dom';
import { ThemeProvider } from './contexts/ThemeContext';

// Import Components
import Navbar from './components/Navbar';
import DashboardLayout from './components/DashboardLayout';
import Footer from './components/Footer';
import styles from './App.module.css';

// Import Pages
import LoginPage from './pages/LoginPage';
import RegisterPage from './pages/RegisterPage';
import DashboardPage from './pages/DashboardPage';
import MenuBuilderPage from './pages/MenuBuilderPage';
import TemplatesPage from './pages/TemplatesPage';
import PublishPage from './pages/PublishPage';
import ProfilePage from './pages/ProfilePage';
import SettingsPage from './pages/SettingsPage';
import ForgotPasswordPage from './pages/ForgotPasswordPage';
import ResetPasswordPage from './pages/ResetPasswordPage';
import GoogleAuthSuccessPage from './pages/GoogleAuthSuccessPage';
import PublicMenuPage from './pages/PublicMenuPage';

// --- NEW: Protected Route Component ---
// This component will act as a guard for our private routes
const ProtectedRoute = ({ children }) => {
  const token = localStorage.getItem('authToken');
  if (!token) {
    // If no token, redirect to the login page
    return <Navigate to="/login" replace />;
  }
  return children;
};

const MainAppLayout = () => (
  <div className={styles.appWrapper}>
    <Navbar />
    <main className={styles.mainContent}>
      <Routes>
        {/* Auth Routes remain public */}
        <Route path="/" element={<LoginPage />} />
        <Route path="/login" element={<LoginPage />} />
        <Route path="/register" element={<RegisterPage />} />
        <Route path="/forgot-password" element={<ForgotPasswordPage />} />
        <Route path="/reset-password/:token" element={<ResetPasswordPage />} />
        <Route path="/auth/success" element={<GoogleAuthSuccessPage />} />

        {/* --- FIX: Wrap protected routes with the ProtectedRoute component --- */}
        <Route 
          path="/dashboard/*" 
          element={
            <ProtectedRoute>
              <DashboardLayoutRoutes />
            </ProtectedRoute>
          } 
        />
        <Route 
          path="/profile" 
          element={
            <ProtectedRoute>
              <ProfilePage />
            </ProtectedRoute>
          } 
        />
        <Route 
          path="/settings" 
          element={
            <ProtectedRoute>
              <SettingsPage />
            </ProtectedRoute>
          } 
        />
      </Routes>
    </main>
    <Footer />
  </div>
);

const DashboardLayoutRoutes = () => (
    <DashboardLayout>
        <Routes>
            <Route index element={<DashboardPage />} />
            <Route path="menu/:menuId" element={<MenuBuilderPage />} />
            <Route path="templates" element={<TemplatesPage />} />
            <Route path="publish" element={<PublishPage />} />
        </Routes>
    </DashboardLayout>
);


function App() {
  return (
    <ThemeProvider>
      <Router>
        <Routes>
          <Route path="/menu/:menuId" element={<PublicMenuPage />} />
          <Route path="/*" element={<MainAppLayout />} />
        </Routes>
      </Router>
    </ThemeProvider>
  );
}

export default App;
